import "./App.css";

function App() {
  const value = "hello wleocme to react";
  const like = 50;

  return (
    <div className="App">
      <header className="App-header">
        <h1>{value}</h1>
        <p>Like is {like} times</p>
        <p>{5}</p>
        <p>{"hello world"}</p>
        <p>{[1, 2, 3, 4]}</p>
        <a href="https://www.google.co.in">Google</a>
      </header>
    </div>
  );
}

export default App;
